INSERT INTO `articles` VALUES ('1','0','Статьи','0','','','','','articles','',''),('3','0','Новости','0','','','','','novosti','',''),('4','3','Охладитель отработавших газов Cummins ISF 3,8 Е-4 (5309068)','0','<p>В продаже появились охладители отработавших газов для двигателя Cummins ISF 3.8</p>\n\n<p>Охладитель отработавших газов Cummins ISF 3,8 Е-4 (5309068) и клапана ЕГР для двигатетеля ISF 3,8</p>\n\n<p>Клапан ЕГР &nbsp;(5309069) Cummins ISF 3,8 Е-4</p>\n\n<p>кроме того в наличии датчики положения коленвала для двигателей Cummins ISF 2.8 для ГАЗель бизнес и ГАЗель Некст (ГАЗель Next) -&nbsp;Датчик полож. коленч.вала нов. обр. Cummins 2,8 (2897342)</p>\n','','','','pervaya-novost','','16-09-2014'),('5','8','Оплата и доставка','0','<p>Наш склад находится в городе Санкт-Петербурге. Доставка по городу осуществляется бесплатно при заказе от 5000 рублей. Также осуществляется доставка во все регионы России транспортными компаниями:</p>\n\n<ul>\n	<li>Деловые Линии;</li>\n	<li>ПЭК;</li>\n	<li>СДЭК;</li>\n	<li>БайкалСервис;</li>\n	<li>Автотрейдинг ;</li>\n	<li>Желдорэкспедиция;\n	<p>Также Ваши заявки и вопросы Вы можете присылать на адрес электронной почты:</p>\n	</li>\n	<li><a href=\"mailto:info@autocummins.ru\">info@autocummins.ru</a></li>\n	<li><a href=\"mailto:alex@autocummins.ru\">alex@autocummins.ru</a></li>\n</ul>\n<iframe src=\"http://widgets.dellin.ru/calculator/?derival_to_door=off&arrival_to_door=on&disabled_calculation=on&insurance_checkbox=off&package=1\" frameborder=\"0\" scrolling=\"no\" width=\"332\" height=\"400\"></iframe>\n\n','','','','delivery','',''),('6','8','Контакты','0','<p>Адрес: Санкт-Петербург, ул. Промышленная д. 5</p>\n\n<p>телефон:</p>\n\n<p><span style=\"font-size:large\">8-800-700-56-47 (звонок по России бесплатный)</span></p>\n\n<p>+7-965-098-15-54</p>\n\n<p>+7-965-098-16-36</p>\n\n<p>+7-965-098-13-87</p>\n\n<p>info@autocummins.ru</p>\n\n<p>alex@autocummins.ru</p>\n','','','','contacts','',''),('7','8','Запчасти для двигателей Cummins ISF 2.8 / ISF 3.8 / ISBe','0','<p>Запчасти Cummins.</p>\r\n<p>Для владельцев автомобилей и строительной техники с двигателями Камминс всегда важно, чтобы принадлежащая им техника была исправна и могла работать и приносить деньги. Поэтому необходимо вовремя обслуживать технику и менять запасные части, которые вышли из строя.</p>\r\n<p>Для решения этих вопросов для наших клиентов мы создали сайт autocummins.ru. Для удобства пользования мы разместили каталоги по двигателям серий ISF и ISBE. Нами разобраны и расписаны по запасным частям самые популярные двигатели Камминс:</p>\r\n<ul>\r\n<li>ISF 2.8 L</li>\r\n<li>ISF 3.8 L</li>\r\n<li>4ISBe (ISBe4.5 L/ISBe185)</li>\r\n<li>6ISBe (ISBe6.7 L/ISBe285/ISBe300)</li>\r\n</ul>\r\n<p>Если Вам необходима помощь в подборе и заказе оригинальных запасных частей Cummins Вы можете позвонить по бесплатному телефону 8-800-700-56-47 и наши специалисты помогут купить запчасти Камминз.</p>\r\n<p>Наш склад находится в городе Санкт-Петербурге. Доставка по городу осуществляется бесплатно при заказе от 5000 рублей. Также осуществляется доставка во все регионы России транспортными компаниями:</p>\r\n<ul>\r\n<li>Деловые Линии;</li>\r\n<li>ПЭК;</li>\r\n<li>СДЭК;</li>\r\n<li>БайкалСервис;</li>\r\n<li>Автотрейдинг ;</li>\r\n<li>Желдорэкспедиция;\r\n<p>Также Ваши заявки и вопросы Вы можете присылать на адрес электронной почты:</p>\r\n<a href=\"mailto:alex@autocummins.ru\">alex@autocummins.ru</a></li>\r\n</ul>','','','','/','',''),('8','0','Информация','0','','','','','info','',''),('9','1','охладитель клапана ЕГР для ISF 2.8 L и ISF 3.8 L','0','<p>Как отличить Охладитель отработавших газов Cummins ISF 3,8 Е-4 (5309068) от&nbsp;Охладителя отработавших газов Cummins ISF 2,8 Е-4 (5263165/5308965/5342842)?</p>\r\n<p>Кстати, Охладителя отработавших газов Cummins ISF 2,8 Е-4 с июля 2014 года выпускается только с номером 5342842.!!!!!</p>\r\n<p>Отличить их можно только по расположению кронштейна.</p>\r\n<p>&nbsp;</p>','','','','ohladitel-klapana-egr-dlya-isf-2-8-l-i-isf-3-8-l','',''),('10','3','ЕГР','0','<p>ЕГР Система рециркуляции отработавших газов &nbsp;(EGR &ndash; Exhaust Gas Recirculation) служит &nbsp;для снижения содержания оксидов азота в отработавших газах автомобиля, путем возврата части выпускных газов во впускной коллектор автомобиля.</p>\n\n<p>На автомашинах <strong>ГАЗель Бизнес с двигателем Камминз </strong><strong>ISF 2.8</strong> <strong>(</strong><strong>Cummins </strong><strong>ISF 2.8</strong>), а также <strong>ГАЗель Некст (</strong><strong>Next) </strong>соответствующим стандартам Евро-4 и <strong>Валдай Камминз (</strong><strong>Cummins)</strong><strong>ISF 3.8</strong> также установлена система рециркуляции <strong>ЕГР.</strong></p>\n\n<p>В настоящее время большим спросом на рынке запчастей Каминз (Камминз) пользуются клапана рециркуляции и охладители клапана рециркуляции отработавших газов для автомобилей Газель Бизнес с двигателем Камминз и Газ 33104 (Валдай) с двигателем Камминз:</p>\n\n<p>- <strong>Клапан</strong><strong> ЕГР</strong><strong>&nbsp; (5309069) Cummins ISF 3,8 Е</strong><strong>-4</strong></p>\n\n<p><strong>- Клапан</strong><strong> ЕГР</strong><strong>&nbsp; (5266683/5262730/5310392) Cummins ISF 2,8 Е</strong><strong>-4</strong></p>\n\n<p><strong>- Охладитель отработавших газов Cummins ISF 2,8 Е-4 (5263165/5308965/5342842)</strong></p>\n\n<p><strong>- Охладитель отработавших газов Cummins ISF 3,8 Е-4 (5309068)</strong></p>\n','','','','egr','','10-10-2014'),('11','3','Форсунка топливная  Denso для Cummins ISF 3,8  Евро4 (5296723)','0','<p>На склад поступила новая партия запчастей для двигателей Cummins ISF 2.8 l и Cummins ISF 3.8 l, соответсвующих стандартам Евро-4.</p>\n\n<p>Так&nbsp;Форсунка топливная Denso для Cummins ISF 3,8 Евро4 (5296723) предлагается по цене 12500.</p>\n\n<p>Кроме того в свободной продаже охладители рециркуляции отработавших газов (охладитель ЕГР) для двигателей Каменц, Камменц, Камминз ISF 2.8 и ISF 3.8</p>\n','','','','forsunka-toplivnaya-denso-dlya-cummins-isf-3-8-evro4-5296723','','17-11-2014'),('12','8','О компании','0','<p>О компании</p>\n','','','','about','',''),('13','1','Крышка блока цилиндров передняя Cummins ISF 2.8l Euro4','0','<p><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong><em>В ближайшее время ожидается поступление крышек передних на двигателя ISF 2.8 l Евро4</em></strong></span></span></p>\n\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong><em>Крышка </em></strong></span></span>5302887&nbsp;<span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong><em>Евро 4 отличается от крышки&nbsp;<span style=\"color:rgb(17, 17, 17)\">5270239 наличием канала для охлаждения модуля рециркуляуции отработавших газов.</span></em></strong></span></span></p>\n\n<p><span style=\"font-size:14px\"><strong><em>Ожидаемая цена на крышку в сборе с теплообменником масляным, насосом водяным и масляным насосом в сборе составляет 16000 рублей.</em></strong></span></p>\n','','','','kryshka-bloka-cylindrov','Крышка блока цилиндров в сборе ГАЗель Бизнес, дв. Камминс (Cummins) 5302887','12-12-2014'),('14','3','Форсунка ГАЗель 5258744','0','<p>Со следующей недели цена на форсунки БОШ для ГАЗель с двигателем Cummins ISF 2.8 l будет составлять 9900 р/шт.</p>\n\n<p>Количество форсунок топлиных 5258744 Bosch # 0445110376 по указанной цене ограничено.</p>\n','','','','forsunka-gazel','Цена на форсунку ГАЗель Дизель 5258744','15-12-2014'),('15','3','Новые поступления','0','<p>Дорогие клиенты!</p>\n\n<p>До Нового Года на склад поступят форсунки топливные 5258744, охладители и клапана ЕГР на двигтеля ISF 2.8 L и ISF 3.8 L. и многие другие позиции.&nbsp;В праздничнын дни склад компании работает не каждый день. График работы склада и возможность приобрести товары утоняйте у сотрудников ООО \"АвтоПауэр\" по многоканальному телефону 8-800-700-56-47</p>\n','','','','novye-postupleniya','','20-12-2014'),('16','3','Заморозка цен','0','<p>Компания ООО \"АвтоПауэр\" замараживает цены на запчасти Камминс \"Cummins\".</p>\n\n<p>До новых поступлений в январе 2015 года мы оставляем цены, существовавшие до 16.12.2014 года. Кроме того все существующие скидки для нмших клиентов остаются без изменений.</p>\n','','','','zamorozka-cen','Цены на Камминс.','21-12-2014'),('17','1','Крышка блока цилиндров передняя Cummins ISF 2.8l Euro4 и Euro3','0','<p>В настоящее время существует 3 вида крышек передних двигателя Cummins ISF 2.8</p>\n\n<p>До января прошлого года на двигателях указанной серии устанавливались крышки&nbsp;5273772. Основное отличие эти крышек от крышек нового образца это отверстие для креплеия датчика положения коленчатого вала. На крышках старого образца стоял датчик 2872277, а на крышках нового образца 5302884&nbsp;крепление датчка расчитано на меньший диаметр датчика&nbsp;2897342. Крышка 5302887&nbsp;для двигателей Евро4 (как правило&nbsp;ГАЗель Некст \"Next\") имеет отверстие для установки датчика нового образца 2894372, а также отличительную особенность от крышек двигателей поколения Евро 3 - канал для отвода охлаждающей жидкости к клапану рециркуляции (ЕГР/EGR)</p>\n','','','','euro4-euro3','5273772/5302884/5302887','23-12-2014');
