INSERT INTO `products` VALUES ('1','3','1','0','Болт с шестигранной головкой сапуна картера двигателя/привода вентилятора Cummins ISF 3,8 (2830411)','7.2','0','','','','bolt-s-shestigrannoj-golovkoj-sapuna-kartera-dvigatelya-privoda-ventilyatora-cummins-isf-3-8-2830411','<p>Болт с шестигранной головкой сапуна картера двигателя/привода вентилятора Cummins ISF 3,8 (2830411) купить эти и другие запчасти Камминз (Cummins) можно в Санкт-Петербурге. Доставка в любые регионы России осуществляется в день обращения (оплаты). Всегда в наличии оригинальные запчасти Cummins (Камминз, Каменц, Камменц, Каминз). Вы можете, обратившись к нам на сайт и самостоятельно подобрав необходимые запчасти используя:<br />\n- каталог Cummins ISF 2,8<br />\n- каталог Cummins ISF 3,8;<br />\n- каталог Cummins 4ISBe;<br />\n- каталог Cummins 6ISBe;<br />\nКроме того можно обратиться к нашим квалифицированным специалистам и они с удовольствием быстро окажут помощь в подборе необходимых товаров. Для клиентов из Санкт-Петербурга осуществляется доставка в пределах города бесплатно при заказе на сумму более 5000 рублей. Также осуществляется доставка во все регионы России.<br />\nВсе запчасти оригинальные, соответствуют высоким стандартам качества Cummins (Камминз, Каминз, Каменц, Камминц). На все запасные части, купленные у ООО &laquo;АвтоПауэр&raquo; на сайте www.autocummins.ru предоставляется гарантия завода изговтовителя (BFCEC &ndash; Beijing Foton Cummins Engine Company или DCEC &ndash; Dongfeng Cummins Engine Company) &ndash; 6 месяцев.</p>\n','2830411','Болт с шестигранной головкой сапуна картера двигателя/привода вентилятора Cummins ISF 3,8 (2830411) ПАЗ-3204, ГАЗ Валдай, ГАЗ-33104, Валдай Камминз (Валдай Cummins)','Cummins','','№2','0'),('2','5','1','0','Прокладка выпускного коллектора Cummins ISF 3,8/ISBe 4,5/ISBe 6,7 (5266422/3955339/2830444/4896350)','114.05','0','','','','prokladka-vypusknogo-kollektora-cummins-isf-3-8-isbe-4-5-isbe-6-7-5266422-3955339-2830444-4896350','Прокладка выпускн